import React from 'react';
import { Link } from 'react-router-dom';
import { useForm } from 'react-hook-form';
import Button from '../Button/Button';
import InputModel from '../Input/Input';

interface FormProps {
    buttonText: string;
    onSubmit: (data: any) => void; 
}

const FormLogin: React.FC<FormProps> = ({ buttonText, onSubmit }) => {
    const { register, handleSubmit, formState: { errors } } = useForm(); // Desestrutura os 'errors' para mostrar mensagens de erro

    const submitForm = (data: any) => {
        onSubmit(data);
    };

    return (
        <>
            <form onSubmit={handleSubmit(submitForm)} className="w-full my-5" action="#" method="POST">
                <InputModel 
                    {...register('email', { required: 'Email is required' })} 
                    type="email"
                    placeholder="Enter your email"
                    error={errors.email ? errors.email.message : null} 
                />
                <Button text={buttonText} />
            </form>

            <hr />
            <div className="flex flex-col gap-3 my-5">
                <a
                    className="w-full text-center p-4 font-medium border border-black rounded-xl hover:bg-black hover:text-white text-heading-blue-secondary text-2xl flex justify-center gap-2"
                    href=""
                >
                    <img src="/Google.svg" className="w-7" alt="Google Icon" /> Continue with Google 
                </a>
                <p className="text-gray-600 text-lg">
                    NÃ£o tem conta ainda? <Link className="hover:underline" to="/Register">Cadastre-se</Link>
                </p>
            </div>
        </>
    );
}

export default FormLogin;
